// Calculate all the active sets
Envil.DPS.activeSets = function(current, opponent)
{
    return Object.keys(Envil.DPS.sets).map(
        (key) =>
        {
            var elm = Envil.DPS.sets[key];
            for (const k in elm[0])
            {
                if (current.active[k] != elm[0][k])
                {
                    //console.log("MISSING", elm[0][k], "IN",key, "SLOT", k, "GOT", current.active[k]);
                    return;
                }
                else
                {
                    //console.log("FOUND", elm[0][k], "IN",key);
                }
            }

            if (elm[2].hasOwnProperty('type') && !opponent.type.hasOwnProperty(elm[2].type))
            {
                //console.log("test");
                return;
            }

            if (elm[2].hasOwnProperty('spellbook') && elm[2].spellbook !== opponent.spellbook)
            {
                //console.log("test");
                return;
            }

            return key;
        }).filter((elm) => elm != null);
};

