// Accuracy formula
Envil.DPS.accuracy = function(attackRoll,defenceRoll)
{
    return attackRoll>defenceRoll ? 1-(defenceRoll+2)/(2*(attackRoll+1)) : attackRoll/(2*(defenceRoll+1))
};

// Calculate rolls, dmg, acc etc from a user compared to their opponent
Envil.DPS.calcData = function(current, opponent)
{
    const style = Envil.DPS.attackMode[current.attackMode];
    var attackRoll = 0;
    var defenceRoll = 0;
    var hit = 0;

    if (style === 'melee')
    {
        attackRoll = Envil.DPS.attackMeleeRoll(current);
        hit = Envil.DPS.maxMeleeRoll(current);
        defenceRoll = Envil.DPS.defenceRoll(opponent, current.attackMode);
    }
    else if (style === 'ranged')
    {
        attackRoll = Envil.DPS.attackRangedRoll(current);
        hit = Envil.DPS.maxRangedRoll(current);
        defenceRoll = Envil.DPS.defenceRoll(opponent, current.attackMode);
    }
    else if (style === 'magic')
    {
        attackRoll = Envil.DPS.attackMagicRoll(current);
        hit = Envil.DPS.maxMagicRoll(current);
        // Players  nd npcs have a different magic roll
        defenceRoll = opponent.hasOwnProperty('player') ? Envil.DPS.defencePlayerMagicRoll(opponent, current.attackMode) : Envil.DPS.defenceMagicRoll(opponent, current.attackMode);
    }

    var acc = Envil.DPS.accuracy(attackRoll,defenceRoll);
    var avgDmg = acc * (hit/2);
    var speed = parseInt(style === 'magic' ? current.spellSpeed : current.equipment[Envil.Item.header.speed]) * 0.6;

    return [attackRoll,hit,defenceRoll,acc,avgDmg/speed];
};

// Calculate every calcData for a user against multiple opponents
Envil.DPS.calc = function(current, opponents)
{
    var output = [];

    opponents.forEach( (opponent) =>
    {
        current.activeSets = Envil.DPS.activeSets(current, opponent);

        output.push(Envil.DPS.calcData(current, opponent));
    });

    return output;
};

// Roll information: https://twitter.com/bitterkoekjers/status/739003659858681856?lang=en and http://services.runescape.com/m=forum/forums.ws?317,318,712,65587452
Envil.DPS.attackMeleeRoll = function(current)
{
    var voidSet = current.activeSets.find((elm) => { return (elm === 'Elite Void (melee)') || (elm === 'Void (melee)')});
    var voidBoost = voidSet === undefined ? 1 : Envil.DPS.sets[voidSet][1].melee ;

    var roll = Math.floor(
        Math.floor(
            (Math.floor( current.stats.attack *
                    Envil.DPS.prayer[current.activePrayer][Envil.DPS.prayerMap.attack] ) +
                Envil.DPS.stance[current.stance][Envil.DPS.stanceMap.attack]
            ) * voidBoost)
        *
        (current.equipment[current.attackMode]+64));

    current.activeSets.filter((elm) => elm != voidSet).forEach( (activeSet) => { roll = Math.floor(roll * (Envil.DPS.sets[activeSet][1].melee || 1)); });

    return roll;
};

Envil.DPS.defenceRoll = function(current, defBonus)
{
    defBonus = Envil.Item.header[Object.keys(Envil.Item.header).find((key) => Envil.Item.header[key] === defBonus).replace('Attack', 'Defence')];

    var roll = Math.floor(
        Math.floor(
            (Math.floor( current.stats.defence * Envil.DPS.prayer[current.activePrayer][Envil.DPS.prayerMap.defence] ) + Envil.DPS.stance[current.stance][Envil.DPS.stanceMap.defence]))
        *
        (current.equipment[defBonus]+64));
    return roll;
};

