// Create an opponent
Envil.DPS.opponent = function()
{
    const types = {};
    types[Envil.DPS.npcType.value.toLowerCase()] = true;

    const equipment = Array(Object.values(Envil.Item.header).length).fill(0);
    equipment[Envil.Item.header.stabDefence] =  parseInt(Envil.DPS.npcStab.value) || 1;
    equipment[Envil.Item.header.slashDefence] = parseInt(Envil.DPS.npcSlash.value) || 1;
    equipment[Envil.Item.header.crushDefence] = parseInt(Envil.DPS.npcCrush.value) || 1;
    equipment[Envil.Item.header.magicDefence] = parseInt(Envil.DPS.npcMagic.value) || 1;
    equipment[Envil.Item.header.rangeDefence] = parseInt(Envil.DPS.npcRanged.value) || 1;

    return {
        activePrayer: 'None',
        stats:
            {
                'strength': 1,
                'attack': 1,
                'defence': parseInt(Envil.DPS.npcDefenceLevel.value) || 1,
                'ranged': 1,
                'magic': parseInt(Envil.DPS.npcMagicLevel.value) || 1,
            },
        type: types,
        stance: 'normal',
        attackMode: 'controlled',
        strBonus: null,
        equipment: equipment,
        active:
            {
                'AMMO': -1,
                'BODY': -1,
                'CAPE': -1,
                'FEET': -1,
                'HAND': -1,
                'HEAD': -1,
                'LEGS': -1,
                'NECK': -1,
                'SHIELD': -1,
                'WEAPON': -1
            },
        spellbook: null,
        spell: null,
    };
};

// Create a current opponent
Envil.DPS.current = function()
{
    var option = Envil.DPS.spellContainer.options[Envil.DPS.spellContainer.selectedIndex];
    //console.log(Envil.Item.result);
    return {
        activePrayer: Envil.DPS.prayerContainer.options[Envil.DPS.prayerContainer.selectedIndex].value,
        stats:
            {
                'strength': parseInt(Envil.DPS.strength.value) || 1,
                'attack': parseInt(Envil.DPS.attack.value) || 1,
                'defence': parseInt(Envil.DPS.defence.value) || 1,
                'ranged': parseInt(Envil.DPS.ranged.value) || 1,
                'magic': parseInt(Envil.DPS.magic.value)  || 1
            },
        type: {'player': true},
        stance:  Envil.DPS.stanceContainer.options[Envil.DPS.stanceContainer.selectedIndex].getAttribute('type'),
        attackMode: Envil.Item.header[Envil.DPS.attackModeContainer.options[Envil.DPS.attackModeContainer.selectedIndex].getAttribute('type')],
        strBonus: Envil.DPS.attackModeContainer.options[Envil.DPS.attackModeContainer.selectedIndex].getAttribute('type').includes('range') ? Envil.Item.header.rangedStrength : Envil.Item.header.strength,
        equipment: Envil.Item.result,
        active: Envil.Item.active,
        spellbook: option.getAttribute('spellbook'),
        spell: option.getAttribute('type'),
        spellSpeed: option.getAttribute('speed')
    };
};

// Using https://stackoverflow.com/questions/9907419/how-to-get-a-key-in-a-javascript-object-by-its-value
Envil.DPS.getKeyByValue = function(object, value) {
    return Object.keys(object).find(key => object[key] === value);
};

Envil.DPS.selectItem = function(dropdown, key, value)
{
    Object.keys(dropdown.options).forEach((k) => {
        const option = dropdown.options[k];

        if ((option.getAttribute(key) != null && option.getAttribute(key).toLowerCase() == value) || option.text == value)
        {
            option.selected = true;
        }
    });
};

// Import all data
Envil.DPS.import = function(data)
{
    Envil.DPS.strength.value = data.stats.strength;
    Envil.DPS.attack.value = data.stats.attack;
    Envil.DPS.defence.value = data.stats.defence;
    Envil.DPS.ranged.value = data.stats.ranged;
    Envil.DPS.magic.value = data.stats.magic;

    Envil.DPS.selectItem(Envil.DPS.prayerContainer, 'text', data.activePrayer);
    Envil.DPS.selectItem(Envil.DPS.stanceContainer, 'type', data.stance.toLowerCase());
    Envil.DPS.selectItem(Envil.DPS.attackModeContainer, 'type', Envil.DPS.getKeyByValue(Envil.Item.header, data.attackMode).toLowerCase());
    Envil.DPS.selectItem(Envil.DPS.spellContainer, 'type', data.spell);
};

// Load all data and containers
Envil.DPS.load = function()
{
    Envil.DPS.spellContainer = document.querySelector('#magicSpell');
    Envil.DPS.attackModeContainer = document.querySelector( '#attackMode' );
    Envil.DPS.stanceContainer = document.querySelector('#stance' );

    Envil.DPS.strength = document.querySelector('#strength');
    Envil.DPS.attack = document.querySelector('#attack');
    Envil.DPS.defence = document.querySelector('#defence');
    Envil.DPS.ranged = document.querySelector('#ranged');
    Envil.DPS.magic = document.querySelector('#magic');

    Envil.DPS.prayerContainer = document.querySelector('#prayer');

    Envil.DPS.resultContainer = document.querySelector('#dpsResult');

    Envil.DPS.npcDefenceLevel = document.querySelector('#npcDefenceLevel');
    Envil.DPS.npcMagicLevel = document.querySelector('#npcMagicLevel');
    Envil.DPS.npcStab = document.querySelector('#npcStab');
    Envil.DPS.npcSlash = document.querySelector('#npcSlash');
    Envil.DPS.npcCrush = document.querySelector('#npcCrush');
    Envil.DPS.npcMagic = document.querySelector('#npcMagic');
    Envil.DPS.npcRanged = document.querySelector('#npcRanged');
    Envil.DPS.npcType = document.querySelector('#npcType');

    Envil.DPS.npcStab.value = 0;
    Envil.DPS.npcSlash.value = 0;
    Envil.DPS.npcCrush.value = 0;
    Envil.DPS.npcMagic.value = 0;
    Envil.DPS.npcRanged.value = 0;

    Envil.DPS.npcMagicLevel.value = 1;
    Envil.DPS.npcDefenceLevel.value = 1;

    Envil.DPS.npcType.value = '';

    ['spellContainer', 'attackModeContainer', 'stanceContainer', 'strength', 'attack', 'defence', 'ranged', 'magic', 'prayerContainer', 'npcDefenceLevel', 'npcMagicLevel', 'npcStab', 'npcSlash', 'npcCrush', 'npcMagic', 'npcRanged', 'npcType'].forEach((elm) =>
    {
        Envil.DPS[elm].addEventListener('change', (e) => Envil.DPS.do() );
    });

    Envil.DPS.npcContainer = document.querySelector('#npcContainer');

    Envil.DPS.NPCs.forEach((npc) => {
        var obj = document.createElement('option');
        obj.text = npc.NPC;
        Envil.DPS.npcContainer.append(obj);
    });

    Envil.DPS.npcContainer.addEventListener('change', (e) =>
    {
        var target = e.target;
        var npc = target.options[target.selectedIndex].text;

        var npcData = Envil.DPS.NPCs.find((elm) => elm.NPC == npc);

        if (npcData == undefined)
        {
            return;
        }

        Envil.DPS.npcStab.value = npcData.Stab;
        Envil.DPS.npcSlash.value = npcData.Slash;
        Envil.DPS.npcCrush.value = npcData.Crush;
        Envil.DPS.npcMagic.value = npcData.Magic;
        Envil.DPS.npcRanged.value = npcData.Ranged;

        Envil.DPS.npcMagicLevel.value = npcData.MagicLevel;
        Envil.DPS.npcDefenceLevel.value = npcData.DefenceLevel;

        Envil.DPS.npcType.value = npcData.Type;

        Envil.DPS.do();
        //console.log(npcData);
    });
};

// Create a basic simulation
Envil.DPS.do = function()
{
    const t = Envil.DPS.current();
    const t2 = Envil.DPS.opponent();
    const data = Envil.DPS.calc(t,[t2])[0];
    console.log(data);
    Envil.DPS.resultContainer.innerHTML = 'Accuracy:' + Math.round(data[3] * 100) / 100 +
        '<br/> DPS: ' +  Math.round(data[4] * 100) / 100 +
        '<br/> Max hit: ' + data[1] ;
};

Envil.addLoad(Envil.DPS.load);